import React from 'react'

function AddEntityModal() {

    return (
        <form>
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Entity</label>
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none"
            }} type="text" />
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Normolized Value</label>
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none"
            }} type="text" />
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Synonym</label>
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none"
            }} type="text" />
        </form>
    )
}

export default AddEntityModal
